import React from 'react';

function Hello(){

    const HelloStyle = {
        backgroundColor:'black'
        , color : 'aqua'
        , fontSize : 34 // 단위는 기본 px 임
        , padding : '1rem' // px 이 아닌 다른 단위 사용시 단위 선언필요
        , textAlign : 'center'
    }

    return(
        <div style={HelloStyle}>회원가입 페이지 입니다.</div>
    );
}

export default Hello;
